function BlockQuote1() {
  return (
    <blockquote className="testimonial-box" id="testimonial-box-1">
      <p className="testimonial-text">
        "Being able to plan my daily activities together with other people it's
        an amazing way to keep myself motivated."
      </p>
      <p className="testimonial-name">Mariana Masera</p>
      <p className="testimonial-description">SEO of Nintendo</p>
    </blockquote>
  );
}

export default BlockQuote1;
